import  React from 'react';

export default  props => (
    <div style={{display:"flex",justifyContent:"center"}} className="todo-item">
    <div className="todo-text" style={{
        textDecoration: props.todo.complete ? "line-through" : ""
    }}
         onClick={props.toggleComplete}> {props.todo.text}
         </div>
        <button  className="todo-item-delete" onClick={props.onDelete}>X</button>
    </div>
);
